import React from 'react';
import Item from './Item.js';

const Results = (props) => {
    return (
        <ul>
            {props.items.map((item) => {
                return (
                    <Item 
                        key={item.id} 
                        onClick={props.removeItem(item.id)}
                        name={item.item}
                    />
                )
            })}
        </ul>
    )
}

export default Results;
